// ==UserScript==
// @name         Replace Base64 Image in JS File
// @namespace    http://tampermonkey.net/
// @version      1.0
// @description  Replace a specific Base64 image in a JS file before it is executed.
// @author       Yang Weiguang
// @match        https://www.xiledong.com/screen/activity/*
// @grant        GM_xmlhttpRequest
// @run-at       document-start
// ==/UserScript==

(function() {
    'use strict';

    if (window.location.href.startsWith('https://www.xiledong.com')) {
        const externalJsUrl = 'https://xldfe.oss-cn-shanghai.aliyuncs.com/screen/js/662.c065a0cc.js';
        // 使用正则表达式匹配开始部分，然后使用通配符匹配剩余部分
        const oldBase64Regex = /t\.exports="data:image\/png;base64,iVBORw0KGgoAAAANSUhEUgAAADwAAAA8AQMAAAAAMksxAAAAA1BMVEWkz[^\"]+"/;
        const newBase64String = 't.exports="data:image/png;base64,"';

        GM_xmlhttpRequest({
            method: 'GET',
            url: externalJsUrl,
            onload: function(response) {
                let modifiedScript = response.responseText.replace(oldBase64Regex, newBase64String);

                const scriptElement = document.createElement('script');
                scriptElement.text = modifiedScript;
                document.documentElement.appendChild(scriptElement);
            },
            onerror: function(error) {
                console.error('Error fetching the external JS:', error);
            }
        });
    }
})();